import { CSSProperties } from "react";

function App() {
  const buttonStyle: CSSProperties = {
    backgroundColor: "pink",
    padding: "10px",
  };

  //h1 태그 색깔은 하늘색, 폰트사이즈 20px
  //h1 태그 내용은 오늘 점심

  const h1Style: CSSProperties = {
    color: "blue",
    fontSize: "20px",
  };
  return (
    <div className="App">
      <button style={buttonStyle}>버튼입니다.</button>
      <h1 style={h1Style}>삼계탕</h1>
    </div>
  );
}

export default App;
